import React, { Component } from 'react';


class App extends Component {

    constructor(props){
        super(props);
        this.state = {
            items: [],
            isLoaded: false,
        }
    }
    componentDidMount() {
        fetch('https://www.googleapis.com/books/v1/volumes?q=time&printType=all&maxResults=40&key=AIzaSyAdsdAFDxo65f7EiJ2ic3NUHEAmHzEVWgw')
        .then(res => res.json())
        .then(json =>  {
            this.setState({
                isLoaded: true,
                items: json,
            })
        });
    }
    render(){

        var { isLoaded,items}=this.state;
        if (!isLoaded){

            return <div> Loaddding...</div>
        }
        else{
            console.log(items)
            return (
                <div className="App">

                    <ul>
                        {items.items?.map(item =>(
                            <li key={item.id}>
                                title: {item.volumeInfo.title} 
                            </li>   
                        ))}; 
                    </ul>

                </div>
        );
    }
}
}

export default App;
